'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/adb-translate/docs/adb/','title':"Adb",'section':"Docs",'content':"C:\\Users\\Admin\u0026gt;adb Android Debug Bridge version 1.0.41 Version 30.0.5-6877874 Installed as C:\\Users\\Admin\\scoop\\apps\\adb\\current\\platform-tools\\adb.exe global options: -a listen on all network interfaces, not just localhost -d use USB device (error if multiple devices connected) -e use TCP/IP device (error if multiple TCP/IP devices available) -s SERIAL use device with given serial (overrides $ANDROID_SERIAL) -t ID use device with given transport id -H name of adb server host [default=localhost] -P port of adb server [default=5037] -L SOCKET listen on given socket for adb server [default=tcp:localhost:5037] general commands: devices [-l] list connected devices (-l for long output) help show this help message version show version num networking: connect HOST[:PORT] connect to a device via TCP/IP [default port=5555] disconnect [HOST[:PORT]] disconnect from given TCP/IP device [default port=5555], or all pair HOST[:PORT] [PAIRING CODE] pair with a device for secure TCP/IP communication forward --list list all forward socket connections forward [--no-rebind] LOCAL REMOTE forward socket connection using: tcp:\u0026lt;port\u0026gt; (\u0026lt;local\u0026gt; may be \u0026#34;tcp:0\u0026#34; to pick any open port) localabstract:\u0026lt;unix domain socket name\u0026gt; localreserved:\u0026lt;unix domain socket name\u0026gt; localfilesystem:\u0026lt;unix domain socket name\u0026gt; dev:\u0026lt;character device name\u0026gt; jdwp:\u0026lt;process pid\u0026gt; (remote only) acceptfd:\u0026lt;fd\u0026gt; (listen only) forward --remove LOCAL remove specific forward socket connection forward --remove-all remove all forward socket connections ppp TTY [PARAMETER...] run PPP over USB reverse --list list all reverse socket connections from device reverse [--no-rebind] REMOTE LOCAL reverse socket connection using: tcp:\u0026lt;port\u0026gt; (\u0026lt;remote\u0026gt; may be \u0026#34;tcp:0\u0026#34; to pick any open port) localabstract:\u0026lt;unix domain socket name\u0026gt; localreserved:\u0026lt;unix domain socket name\u0026gt; localfilesystem:\u0026lt;unix domain socket name\u0026gt; reverse --remove REMOTE remove specific reverse socket connection reverse --remove-all remove all reverse socket connections from device mdns check check if mdns discovery is available mdns services list all discovered services file transfer: push [--sync] [-z ALGORITHM] [-Z] LOCAL... REMOTE copy local files/directories to device --sync: only push files that are newer on the host than the device -n: dry run: push files to device without storing to the filesystem -z: enable compression with a specified algorithm (any, none, brotli) -Z: disable compression pull [-a] [-z ALGORITHM] [-Z] REMOTE... LOCAL copy files/dirs from device -a: preserve file timestamp and mode -z: enable compression with a specified algorithm (any, none, brotli) -Z: disable compression sync [-l] [-z ALGORITHM] [-Z] [all|data|odm|oem|product|system|system_ext|vendor] sync a local build from $ANDROID_PRODUCT_OUT to the device (default all) -n: dry run: push files to device without storing to the filesystem -l: list files that would be copied, but don\u0026#39;t copy them -z: enable compression with a specified algorithm (any, none, brotli) -Z: disable compression shell: shell [-e ESCAPE] [-n] [-Tt] [-x] [COMMAND...] run remote shell command (interactive shell if no command given) -e: choose escape character, or \u0026#34;none\u0026#34;; default \u0026#39;~\u0026#39; -n: don\u0026#39;t read from stdin -T: disable pty allocation -t: allocate a pty if on a tty (-tt: force pty allocation) -x: disable remote exit codes and stdout/stderr separation emu COMMAND run emulator console command app installation (see also `adb shell cmd package help`): install [-lrtsdg] [--instant] PACKAGE push a single package to the device and install it install-multiple [-lrtsdpg] [--instant] PACKAGE... push multiple APKs to the device for a single package and install them install-multi-package [-lrtsdpg] [--instant] PACKAGE... push one or more packages to the device and install them atomically -r: replace existing application -t: allow test packages -d: allow version code downgrade (debuggable packages only) -p: partial application install (install-multiple only) -g: grant all runtime permissions --abi ABI: override platform\u0026#39;s default ABI --instant: cause the app to be installed as an ephemeral install app --no-streaming: always push APK to device and invoke Package Manager as separate steps --streaming: force streaming APK directly into Package Manager --fastdeploy: use fast deploy --no-fastdeploy: prevent use of fast deploy --force-agent: force update of deployment agent when using fast deploy --date-check-agent: update deployment agent when local version is newer and using fast deploy --version-check-agent: update deployment agent when local version has different version code and using fast deploy (See also `adb shell pm help` for more options.) uninstall [-k] PACKAGE remove this app package from the device \u0026#39;-k\u0026#39;: keep the data and cache directories debugging: bugreport [PATH] write bugreport to given PATH [default=bugreport.zip]; if PATH is a directory, the bug report is saved in that directory. devices that don\u0026#39;t support zipped bug reports output to stdout. jdwp list pids of processes hosting a JDWP transport logcat show device log (logcat --help for more) security: disable-verity disable dm-verity checking on userdebug builds enable-verity re-enable dm-verity checking on userdebug builds keygen FILE generate adb public/private key; private key stored in FILE, scripting: wait-for[-TRANSPORT]-STATE... wait for device to be in a given state STATE: device, recovery, rescue, sideload, bootloader, or disconnect TRANSPORT: usb, local, or any [default=any] get-state print offline | bootloader | device get-serialno print \u0026lt;serial-number\u0026gt; get-devpath print \u0026lt;device-path\u0026gt; remount [-R] remount partitions read-write. if a reboot is required, -R will will automatically reboot the device. reboot [bootloader|recovery|sideload|sideload-auto-reboot] reboot the device; defaults to booting system image but supports bootloader and recovery too. sideload reboots into recovery and automatically starts sideload mode, sideload-auto-reboot is the same but reboots after sideloading. sideload OTAPACKAGE sideload the given full OTA package root restart adbd with root permissions unroot restart adbd without root permissions usb restart adbd listening on USB tcpip PORT restart adbd listening on TCP on PORT internal debugging: start-server ensure that there is a server running kill-server kill the server if it is running reconnect kick connection from host side to force reconnect reconnect device kick connection from device side to force reconnect reconnect offline reset offline/unauthorized devices to force reconnect environment variables: $ADB_TRACE comma-separated list of debug info to log: all,adb,sockets,packets,rwx,usb,sync,sysdeps,transport,jdwp $ADB_VENDOR_KEYS colon-separated list of keys (files or directories) $ANDROID_SERIAL serial number to connect to (see -s) $ANDROID_LOG_TAGS tags to be used by logcat (see logcat --help) $ADB_LOCAL_TRANSPORT_MAX_PORT max emulator scan port (default 5585, 16 emus) $ADB_MDNS_AUTO_CONNECT comma-separated list of mdns services to allow auto-connect (default adb-tls-connect) "});index.add({'id':1,'href':'/adb-translate/docs/am/','title':"Am",'section':"Docs",'content':"am 命令 :/system/bin # am 活动管理命令如下： help 打印这个帮助 用法： am help start-activity [-D] [-N] [-W] [-P \u0026lt;FILE\u0026gt;] [--start-profiler \u0026lt;FILE\u0026gt;] [--sampling INTERVAL] [--streaming] [-R COUNT] [-S] [--track-allocation] [--user \u0026lt;USER_ID\u0026gt; | current] \u0026lt;INTENT\u0026gt; 启动一个活动。参数选项如下： -D: enable debugging 开启调试 -N: enable native debugging 开启 native 调试 -W: wait for launch to complete 等待活动启动完全 --start-profiler \u0026lt;FILE\u0026gt;: start profiler and send results to \u0026lt;FILE\u0026gt; 启动性能剖析器并将结果发送至 \u0026lt;FILE\u0026gt; --sampling INTERVAL: use sample profiling with INTERVAL microseconds between samples (use with --start-profiler) 使用INTERVAL微秒的样本分析 样本之间（与 --start-profiler 一起使用） --streaming: stream the profiling output to the specified file (use with --start-profiler) 将分析的数据流输出 到指定文件 （与 --start-profiler 一起使用） -P \u0026lt;FILE\u0026gt;: like above, but profiling stops when app goes idle 类似于 --start-profiler，但当应用进入空闲状态时剖析停止 --attach-agent \u0026lt;agent\u0026gt;: attach the given agent before binding --attach-agent-bind \u0026lt;agent\u0026gt;: attach the given agent during binding -R: repeat the activity launch \u0026lt;COUNT\u0026gt; times. Prior to each repeat, the top activity will be finished. 重复启动 Activity count 次。在每次重复前，将完成顶层 Activity -S: force stop the target app before starting the activity 在启动 Activity 前，强行停止目标应用 --track-allocation: enable tracking of object allocations --user \u0026lt;USER_ID\u0026gt; | current: Specify which user to run as; if not specified then run as the current user. 指定要作为哪个用户运行；如果未指定，则作为当前用户运行 --windowingMode \u0026lt;WINDOWING_MODE\u0026gt;: The windowing mode to launch the activity into. 将活动启动到指定窗口模式 --activityType \u0026lt;ACTIVITY_TYPE\u0026gt;: The activity type to launch the activity as. start-activity [-D] [-N] [-W] [-P \u0026lt;FILE\u0026gt;] [--start-profiler \u0026lt;FILE\u0026gt;] [--sampling INTERVAL] [--streaming] [-R COUNT] [-S] [--track-allocation] [--user \u0026lt;USER_ID\u0026gt; | current] \u0026lt;INTENT\u0026gt; Start an Activity. Options are: -D: enable debugging -N: enable native debugging -W: wait for launch to complete --start-profiler \u0026lt;FILE\u0026gt;: start profiler and send results to \u0026lt;FILE\u0026gt; --sampling INTERVAL: use sample profiling with INTERVAL microseconds between samples (use with --start-profiler) --streaming: stream the profiling output to the specified file (use with --start-profiler) -P \u0026lt;FILE\u0026gt;: like above, but profiling stops when app goes idle --attach-agent \u0026lt;agent\u0026gt;: attach the given agent before binding --attach-agent-bind \u0026lt;agent\u0026gt;: attach the given agent during binding -R: repeat the activity launch \u0026lt;COUNT\u0026gt; times. Prior to each repeat, the top activity will be finished. -S: force stop the target app before starting the activity --track-allocation: enable tracking of object allocations --user \u0026lt;USER_ID\u0026gt; | current: Specify which user to run as; if not specified then run as the current user. --windowingMode \u0026lt;WINDOWING_MODE\u0026gt;: The windowing mode to launch the activity into. --activityType \u0026lt;ACTIVITY_TYPE\u0026gt;: The activity type to launch the activity as. 用法： am help start-service [--user \u0026lt;USER_ID\u0026gt; | current] \u0026lt;INTENT\u0026gt; Start a Service. Options are: --user \u0026lt;USER_ID\u0026gt; | current: Specify which user to run as; if not specified then run as the current user. start-foreground-service [--user \u0026lt;USER_ID\u0026gt; | current] \u0026lt;INTENT\u0026gt; Start a foreground Service. Options are: --user \u0026lt;USER_ID\u0026gt; | current: Specify which user to run as; if not specified then run as the current user. stop-service [--user \u0026lt;USER_ID\u0026gt; | current] \u0026lt;INTENT\u0026gt; Stop a Service. Options are: --user \u0026lt;USER_ID\u0026gt; | current: Specify which user to run as; if not specified then run as the current user. broadcast [--user \u0026lt;USER_ID\u0026gt; | all | current] \u0026lt;INTENT\u0026gt; Send a broadcast Intent. Options are: --user \u0026lt;USER_ID\u0026gt; | all | current: Specify which user to send to; if not specified then send to all users. --receiver-permission \u0026lt;PERMISSION\u0026gt;: Require receiver to hold permission. instrument [-r] [-e \u0026lt;NAME\u0026gt; \u0026lt;VALUE\u0026gt;] [-p \u0026lt;FILE\u0026gt;] [-w] [--user \u0026lt;USER_ID\u0026gt; | current] [--no-hidden-api-checks] [--no-window-animation] [--abi \u0026lt;ABI\u0026gt;] \u0026lt;COMPONENT\u0026gt; Start an Instrumentation. Typically this target \u0026lt;COMPONENT\u0026gt; is in the form \u0026lt;TEST_PACKAGE\u0026gt;/\u0026lt;RUNNER_CLASS\u0026gt; or only \u0026lt;TEST_PACKAGE\u0026gt; if there is only one instrumentation. Options are: -r: print raw results (otherwise decode REPORT_KEY_STREAMRESULT). Use with [-e perf true] to generate raw output for performance measurements. -e \u0026lt;NAME\u0026gt; \u0026lt;VALUE\u0026gt;: set argument \u0026lt;NAME\u0026gt; to \u0026lt;VALUE\u0026gt;. For test runners a common form is [-e \u0026lt;testrunner_flag\u0026gt; \u0026lt;value\u0026gt;[,\u0026lt;value\u0026gt;...]]. -p \u0026lt;FILE\u0026gt;: write profiling data to \u0026lt;FILE\u0026gt; -m: Write output as protobuf to stdout (machine readable) -f \u0026lt;Optional PATH/TO/FILE\u0026gt;: Write output as protobuf to a file (machine readable). If path is not specified, default directory and file name will be used: /sdcard/instrument-logs/log-yyyyMMdd-hhmmss-SSS.instrumentation_data_proto -w: wait for instrumentation to finish before returning. Required for test runners. --user \u0026lt;USER_ID\u0026gt; | current: Specify user instrumentation runs in; current user if not specified. --no-hidden-api-checks: disable restrictions on use of hidden API. --no-window-animation: turn off window animations while running. --abi \u0026lt;ABI\u0026gt;: Launch the instrumented process with the selected ABI. This assumes that the process supports the selected ABI. trace-ipc [start|stop] [--dump-file \u0026lt;FILE\u0026gt;] Trace IPC transactions. start: start tracing IPC transactions. stop: stop tracing IPC transactions and dump the results to file. --dump-file \u0026lt;FILE\u0026gt;: Specify the file the trace should be dumped to. profile [start|stop] [--user \u0026lt;USER_ID\u0026gt; current] [--sampling INTERVAL] [--streaming] \u0026lt;PROCESS\u0026gt; \u0026lt;FILE\u0026gt; Start and stop profiler on a process. The given \u0026lt;PROCESS\u0026gt; argument may be either a process name or pid. Options are: --user \u0026lt;USER_ID\u0026gt; | current: When supplying a process name, specify user of process to profile; uses current user if not specified. --sampling INTERVAL: use sample profiling with INTERVAL microseconds between samples --streaming: stream the profiling output to the specified file dumpheap [--user \u0026lt;USER_ID\u0026gt; current] [-n] [-g] \u0026lt;PROCESS\u0026gt; \u0026lt;FILE\u0026gt; Dump the heap of a process. The given \u0026lt;PROCESS\u0026gt; argument may be either a process name or pid. Options are: -n: dump native heap instead of managed heap -g: force GC before dumping the heap --user \u0026lt;USER_ID\u0026gt; | current: When supplying a process name, specify user of process to dump; uses current user if not specified. set-debug-app [-w] [--persistent] \u0026lt;PACKAGE\u0026gt; Set application \u0026lt;PACKAGE\u0026gt; to debug. Options are: -w: wait for debugger when application starts --persistent: retain this value clear-debug-app Clear the previously set-debug-app. set-watch-heap \u0026lt;PROCESS\u0026gt; \u0026lt;MEM-LIMIT\u0026gt; Start monitoring pss size of \u0026lt;PROCESS\u0026gt;, if it is at or above \u0026lt;HEAP-LIMIT\u0026gt; then a heap dump is collected for the user to report. clear-watch-heap Clear the previously set-watch-heap. bug-report [--progress | --telephony] Request bug report generation; will launch a notification when done to select where it should be delivered. Options are: --progress: will launch a notification right away to show its progress. --telephony: will dump only telephony sections. force-stop [--user \u0026lt;USER_ID\u0026gt; | all | current] \u0026lt;PACKAGE\u0026gt; Completely stop the given application package. crash [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE|PID\u0026gt; Induce a VM crash in the specified package or process kill [--user \u0026lt;USER_ID\u0026gt; | all | current] \u0026lt;PACKAGE\u0026gt; Kill all background processes associated with the given application. kill-all Kill all processes that are safe to kill (cached, etc). make-uid-idle [--user \u0026lt;USER_ID\u0026gt; | all | current] \u0026lt;PACKAGE\u0026gt; If the given application\u0026#39;s uid is in the background and waiting to become idle (not allowing background services), do that now. monitor [--gdb \u0026lt;port\u0026gt;] Start monitoring for crashes or ANRs. --gdb: start gdbserv on the given port at crash/ANR watch-uids [--oom \u0026lt;uid\u0026gt;] Start watching for and reporting uid state changes. --oom: specify a uid for which to report detailed change messages. hang [--allow-restart] Hang the system. --allow-restart: allow watchdog to perform normal system restart restart Restart the user-space system. idle-maintenance Perform idle maintenance now. screen-compat [on|off] \u0026lt;PACKAGE\u0026gt; Control screen compatibility mode of \u0026lt;PACKAGE\u0026gt;. package-importance \u0026lt;PACKAGE\u0026gt; Print current importance of \u0026lt;PACKAGE\u0026gt;. to-uri [INTENT] Print the given Intent specification as a URI. to-intent-uri [INTENT] Print the given Intent specification as an intent: URI. to-app-uri [INTENT] Print the given Intent specification as an android-app: URI. switch-user \u0026lt;USER_ID\u0026gt; Switch to put USER_ID in the foreground, starting execution of that user if it is currently stopped. get-current-user Returns id of the current foreground user. start-user \u0026lt;USER_ID\u0026gt; Start USER_ID in background if it is currently stopped; use switch-user if you want to start the user in foreground unlock-user \u0026lt;USER_ID\u0026gt; [TOKEN_HEX] Attempt to unlock the given user using the given authorization token. stop-user [-w] [-f] \u0026lt;USER_ID\u0026gt; Stop execution of USER_ID, not allowing it to run any code until a later explicit start or switch to it. -w: wait for stop-user to complete. -f: force stop even if there are related users that cannot be stopped. is-user-stopped \u0026lt;USER_ID\u0026gt; Returns whether \u0026lt;USER_ID\u0026gt; has been stopped or not. get-started-user-state \u0026lt;USER_ID\u0026gt; Gets the current state of the given started user. track-associations Enable association tracking. untrack-associations Disable and clear association tracking. get-uid-state \u0026lt;UID\u0026gt; Gets the process state of an app given its \u0026lt;UID\u0026gt;. attach-agent \u0026lt;PROCESS\u0026gt; \u0026lt;FILE\u0026gt; Attach an agent to the specified \u0026lt;PROCESS\u0026gt;, which may be either a process name or a PID. get-config [--days N] [--device] [--proto] Retrieve the configuration and any recent configurations of the device. --days: also return last N days of configurations that have been seen. --device: also output global device configuration info. --proto: return result as a proto; does not include --days info. supports-multiwindow Returns true if the device supports multiwindow. supports-split-screen-multi-window Returns true if the device supports split screen multiwindow. suppress-resize-config-changes \u0026lt;true|false\u0026gt; Suppresses configuration changes due to user resizing an activity/task. set-inactive [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE\u0026gt; true|false Sets the inactive state of an app. get-inactive [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE\u0026gt; Returns the inactive state of an app. set-standby-bucket [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE\u0026gt; active|working_set|frequent|rare Puts an app in the standby bucket. get-standby-bucket [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE\u0026gt; Returns the standby bucket of an app. send-trim-memory [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PROCESS\u0026gt; [HIDDEN|RUNNING_MODERATE|BACKGROUND|RUNNING_LOW|MODERATE|RUNNING_CRITICAL|COMPLETE] Send a memory trim event to a \u0026lt;PROCESS\u0026gt;. May also supply a raw trim int level. display [COMMAND] [...]: sub-commands for operating on displays. move-stack \u0026lt;STACK_ID\u0026gt; \u0026lt;DISPLAY_ID\u0026gt; Move \u0026lt;STACK_ID\u0026gt; from its current display to \u0026lt;DISPLAY_ID\u0026gt;. stack [COMMAND] [...]: sub-commands for operating on activity stacks. start \u0026lt;DISPLAY_ID\u0026gt; \u0026lt;INTENT\u0026gt; Start a new activity on \u0026lt;DISPLAY_ID\u0026gt; using \u0026lt;INTENT\u0026gt; move-task \u0026lt;TASK_ID\u0026gt; \u0026lt;STACK_ID\u0026gt; [true|false] Move \u0026lt;TASK_ID\u0026gt; from its current stack to the top (true) or bottom (false) of \u0026lt;STACK_ID\u0026gt;. resize \u0026lt;STACK_ID\u0026gt; \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt; Change \u0026lt;STACK_ID\u0026gt; size and position to \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt;. resize-animated \u0026lt;STACK_ID\u0026gt; \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt; Same as resize, but allow animation. resize-docked-stack \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt; [\u0026lt;TASK_LEFT,TASK_TOP,TASK_RIGHT,TASK_BOTTOM\u0026gt;] Change docked stack to \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt; and supplying temporary different task bounds indicated by \u0026lt;TASK_LEFT,TOP,RIGHT,BOTTOM\u0026gt; move-top-activity-to-pinned-stack: \u0026lt;STACK_ID\u0026gt; \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt; Moves the top activity from \u0026lt;STACK_ID\u0026gt; to the pinned stack using \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt; for the bounds of the pinned stack. positiontask \u0026lt;TASK_ID\u0026gt; \u0026lt;STACK_ID\u0026gt; \u0026lt;POSITION\u0026gt; Place \u0026lt;TASK_ID\u0026gt; in \u0026lt;STACK_ID\u0026gt; at \u0026lt;POSITION\u0026gt; list List all of the activity stacks and their sizes. info \u0026lt;WINDOWING_MODE\u0026gt; \u0026lt;ACTIVITY_TYPE\u0026gt; Display the information about activity stack in \u0026lt;WINDOWING_MODE\u0026gt; and \u0026lt;ACTIVITY_TYPE\u0026gt;. remove \u0026lt;STACK_ID\u0026gt; Remove stack \u0026lt;STACK_ID\u0026gt;. task [COMMAND] [...]: sub-commands for operating on activity tasks. lock \u0026lt;TASK_ID\u0026gt; Bring \u0026lt;TASK_ID\u0026gt; to the front and don\u0026#39;t allow other tasks to run. lock stop End the current task lock. resizeable \u0026lt;TASK_ID\u0026gt; [0|1|2|3] Change resizeable mode of \u0026lt;TASK_ID\u0026gt; to one of the following: 0: unresizeable 1: crop_windows 2: resizeable 3: resizeable_and_pipable resize \u0026lt;TASK_ID\u0026gt; \u0026lt;LEFT,TOP,RIGHT,BOTTOM\u0026gt; Makes sure \u0026lt;TASK_ID\u0026gt; is in a stack with the specified bounds. Forces the task to be resizeable and creates a stack if no existing stack has the specified bounds. update-appinfo \u0026lt;USER_ID\u0026gt; \u0026lt;PACKAGE_NAME\u0026gt; [\u0026lt;PACKAGE_NAME\u0026gt;...] Update the ApplicationInfo objects of the listed packages for \u0026lt;USER_ID\u0026gt; without restarting any processes. write Write all pending state to storage. \u0026lt;INTENT\u0026gt; specifications include these flags and arguments: [-a \u0026lt;ACTION\u0026gt;] [-d \u0026lt;DATA_URI\u0026gt;] [-t \u0026lt;MIME_TYPE\u0026gt;] [-c \u0026lt;CATEGORY\u0026gt; [-c \u0026lt;CATEGORY\u0026gt;] ...] [-n \u0026lt;COMPONENT_NAME\u0026gt;] [-e|--es \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_STRING_VALUE\u0026gt; ...] [--esn \u0026lt;EXTRA_KEY\u0026gt; ...] [--ez \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_BOOLEAN_VALUE\u0026gt; ...] [--ei \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_INT_VALUE\u0026gt; ...] [--el \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_LONG_VALUE\u0026gt; ...] [--ef \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_FLOAT_VALUE\u0026gt; ...] [--eu \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_URI_VALUE\u0026gt; ...] [--ecn \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_COMPONENT_NAME_VALUE\u0026gt;] [--eia \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_INT_VALUE\u0026gt;[,\u0026lt;EXTRA_INT_VALUE...]] (mutiple extras passed as Integer[]) [--eial \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_INT_VALUE\u0026gt;[,\u0026lt;EXTRA_INT_VALUE...]] (mutiple extras passed as List\u0026lt;Integer\u0026gt;) [--ela \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_LONG_VALUE\u0026gt;[,\u0026lt;EXTRA_LONG_VALUE...]] (mutiple extras passed as Long[]) [--elal \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_LONG_VALUE\u0026gt;[,\u0026lt;EXTRA_LONG_VALUE...]] (mutiple extras passed as List\u0026lt;Long\u0026gt;) [--efa \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_FLOAT_VALUE\u0026gt;[,\u0026lt;EXTRA_FLOAT_VALUE...]] (mutiple extras passed as Float[]) [--efal \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_FLOAT_VALUE\u0026gt;[,\u0026lt;EXTRA_FLOAT_VALUE...]] (mutiple extras passed as List\u0026lt;Float\u0026gt;) [--esa \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_STRING_VALUE\u0026gt;[,\u0026lt;EXTRA_STRING_VALUE...]] (mutiple extras passed as String[]; to embed a comma into a string, escape it using \u0026#34;\\,\u0026#34;) [--esal \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_STRING_VALUE\u0026gt;[,\u0026lt;EXTRA_STRING_VALUE...]] (mutiple extras passed as List\u0026lt;String\u0026gt;; to embed a comma into a string, escape it using \u0026#34;\\,\u0026#34;) [-f \u0026lt;FLAG\u0026gt;] [--grant-read-uri-permission] [--grant-write-uri-permission] [--grant-persistable-uri-permission] [--grant-prefix-uri-permission] [--debug-log-resolution] [--exclude-stopped-packages] [--include-stopped-packages] [--activity-brought-to-front] [--activity-clear-top] [--activity-clear-when-task-reset] [--activity-exclude-from-recents] [--activity-launched-from-history] [--activity-multiple-task] [--activity-no-animation] [--activity-no-history] [--activity-no-user-action] [--activity-previous-is-top] [--activity-reorder-to-front] [--activity-reset-task-if-needed] [--activity-single-top] [--activity-clear-task] [--activity-task-on-home] [--activity-match-external] [--receiver-registered-only] [--receiver-replace-pending] [--receiver-foreground] [--receiver-no-abort] [--receiver-include-background] [--selector] [\u0026lt;URI\u0026gt; | \u0026lt;PACKAGE\u0026gt; | \u0026lt;COMPONENT\u0026gt;] "});index.add({'id':2,'href':'/adb-translate/docs/appops/','title':"Appops",'section':"Docs",'content':":/system/bin # appops AppOps service (appops) commands: help Print this help text. start [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE | UID\u0026gt; \u0026lt;OP\u0026gt; Starts a given operation for a particular application. stop [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE | UID\u0026gt; \u0026lt;OP\u0026gt; Stops a given operation for a particular application. set [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE | UID\u0026gt; \u0026lt;OP\u0026gt; \u0026lt;MODE\u0026gt; Set the mode for a particular application and operation. get [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE | UID\u0026gt; [\u0026lt;OP\u0026gt;] Return the mode for a particular application and optional operation. query-op [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;OP\u0026gt; [\u0026lt;MODE\u0026gt;] Print all packages that currently have the given op in the given mode. reset [--user \u0026lt;USER_ID\u0026gt;] [\u0026lt;PACKAGE\u0026gt;] Reset the given application or all applications to default modes. write-settings Immediately write pending changes to storage. read-settings Read the last written settings, replacing current state in RAM. options: \u0026lt;PACKAGE\u0026gt; an Android package name. \u0026lt;OP\u0026gt; an AppOps operation. \u0026lt;MODE\u0026gt; one of allow, ignore, deny, or default \u0026lt;USER_ID\u0026gt; the user id under which the package is installed. If --user is not specified, the current user is assumed. "});index.add({'id':3,'href':'/adb-translate/docs/busybox/','title':"Busybox",'section':"Docs",'content':":/system/bin # busybox BusyBox v1.31.1-osm0sis (2020-05-06 20:45:25 ADT) multi-call binary. BusyBox is copyrighted by many authors between 1998-2015. Licensed under GPLv2. See source distribution for detailed copyright notices. Usage: busybox [function [arguments]...] or: busybox --list[-full] or: busybox --show SCRIPT or: busybox --install [-s] [DIR] or: function [arguments]... BusyBox is a multi-call binary that combines many common Unix utilities into a single executable. Most people will create a link to busybox for each function they wish to use and BusyBox will act like whatever it was invoked as. Currently defined functions: [, [[, acpid, adjtimex, ar, arch, arp, arping, ash, awk, base64, basename, bbconfig, beep, blkdiscard, blkid, blockdev, brctl, bunzip2, bzcat, bzip2, cal, cat, chat, chattr, chcon, chgrp, chmod, chown, chroot, chrt, chvt, cksum, clear, cmp, comm, conspy, cp, cpio, crond, crontab, cttyhack, cut, date, dc, dd, deallocvt, depmod, devmem, df, dhcprelay, diff, dirname, dmesg, dnsd, dnsdomainname, dos2unix, du, dumpkmap, dumpleases, echo, ed, egrep, eject, env, ether-wake, expand, expr, factor, fakeidentd, false, fatattr, fbset, fbsplash, fdflush, fdformat, fdisk, fgconsole, fgrep, find, findfs, flash_eraseall, flash_lock, flash_unlock, flock, fold, free, freeramdisk, fsck, fsck.minix, fsfreeze, fstrim, fsync, ftpd, ftpget, ftpput, fuser, getenforce, getopt, grep, groups, gunzip, gzip, hd, hdparm, head, hexdump, hexedit, hostname, httpd, hush, hwclock, id, ifconfig, ifdown, ifenslave, ifplugd, ifup, inetd, inotifyd, insmod, install, ionice, iostat, ip, ipaddr, ipcalc, ipcrm, ipcs, iplink, ipneigh, iproute, iprule, iptunnel, kbd_mode, kill, killall, killall5, klogd, less, link, ln, loadfont, loadkmap, logread, losetup, ls, lsattr, lsmod, lsof, lspci, lsscsi, lsusb, lzcat, lzma, lzop, lzopcat, makedevs, makemime, man, md5sum, mesg, microcom, mkdir, mkdosfs, mke2fs, mkfifo, mkfs.ext2, mkfs.minix, mkfs.reiser, mkfs.vfat, mknod, mkswap, mktemp, modinfo, modprobe, more, mount, mountpoint, mpstat, mv, nameif, nanddump, nandwrite, nbd-client, nc, netstat, nice, nl, nmeter, nohup, nologin, nslookup, nuke, od, openvt, partprobe, paste, patch, pgrep, pidof, ping, ping6, pipe_progress, pivot_root, pkill, pmap, popmaildir, poweroff, powertop, printenv, printf, ps, pscan, pstree, pwd, pwdx, raidautorun, rdate, rdev, readlink, readprofile, realpath, reboot, reformime, renice, reset, resize, resume, rev, rfkill, rm, rmdir, rmmod, route, rtcwake, run-init, run-parts, runcon, rx, script, scriptreplay, sed, selinuxenabled, sendmail, seq, sestatus, setconsole, setenforce, setfattr, setfont, setkeycodes, setlogcons, setpriv, setserial, setsid, setuidgid, sh, sha1sum, sha256sum, sha3sum, sha512sum, showkey, shred, shuf, slattach, sleep, smemcap, sort, split, ssl_client, start-stop-daemon, stat, strings, stty, sum, svc, svok, swapoff, swapon, switch_root, sync, sysctl, syslogd, tac, tail, tar, tc, tcpsvd, tee, telnet, telnetd, test, tftp, tftpd, time, timeout, top, touch, tr, traceroute, traceroute6, true, truncate, ts, tty, ttysize, tunctl, tune2fs, ubiattach, ubidetach, ubimkvol, ubirename, ubirmvol, ubirsvol, ubiupdatevol, udhcpc, udhcpc6, udhcpd, udpsvd, uevent, umount, uname, uncompress, unexpand, uniq, unix2dos, unlink, unlzma, unlzop, unshare, unxz, unzip, uptime, usleep, uudecode, uuencode, vconfig, vi, volname, watch, watchdog, wc, wget, which, whoami, whois, xargs, xxd, xz, xzcat, yes, zcat, zcip "});index.add({'id':4,'href':'/adb-translate/docs/cmd/','title':"Cmd",'section':"Docs",'content':":/system/bin # cmd cmd: No service specified; use -l to list all services 20|:/system/bin # cmd -l Currently running services: DockObserver MiuiBackup MiuiInit ProcessManager SurfaceFlinger accessibility account activity alarm android.security.keystore android.service.gatekeeper.IGateKeeperService appops appwidget audio autofill backup battery batteryproperties batterystats binder_calls_stats bluetooth_manager carrier_config clipboard cneservice com.goodix.FingerprintService com.qualcomm.location.izat.IzatService commontime_management companiondevice connectivity connmetrics consumer_ir content contexthub country_detector cpuinfo crossprofileapps dbinfo device_identifiers device_policy deviceidle devicestoragemonitor diskstats display dpmservice dreams drm.drmManager dropbox ethernet extphone fingerprint gfxinfo gpu graphicsstats hardware_properties imms incident input input_method installd iphonesubinfo ipsec isms isub jobscheduler launcherapps location locationpolicy lock_settings media.audio_flinger media.audio_policy media.camera media.camera.proxy media.drm media.extractor media.metrics media.player media.resource_manager media.sound_trigger_hw media_projection media_resource_monitor media_router media_session meminfo midi miui.contentcatcher.ContentCatcherService miui.face.FaceService miui.fdpp miui.mqsas.IMQSNative miui.mqsas.MQSService miui.sedc miui.shell miui.whetstone.klo miui.whetstone.mcd miui.whetstone.power miuiboosterservice mount netd netd_listener netpolicy netstats network_management network_score network_time_update_service network_watchlist nfc notification oem_lock otadexopt overlay package package_native perfshielder permission persistent_data_block phone pinner power print processinfo procstats qti.ims.ext recovery restrictions scheduling_policy search sec_key_att_app_id_provider secure_element security sensorservice serial servicediscovery settings shortcut simphonebook sip slice soundtrigger stats statscompanion statusbar storaged storaged_pri storagestats system_update telecom telephony.registry textclassification textservices thermalservice trust uce uimode updatelock usagestats usb user vendor.perfservice vibrator voiceinteraction vold vrmanager wallpaper webviewupdate whetstone.activity wifi wificond wifip2p wifiscanner window xiaomi.aiasstvison xiaomi.joyose "});index.add({'id':5,'href':'/adb-translate/docs/dpm/','title':"Dpm",'section':"Docs",'content':":/system/bin # dpm usage: dpm [subcommand] [options] usage: dpm set-active-admin [ --user \u0026lt;USER_ID\u0026gt; | current ] \u0026lt;COMPONENT\u0026gt; usage: dpm set-device-owner [ --user \u0026lt;USER_ID\u0026gt; | current *EXPERIMENTAL* ] [ --name \u0026lt;NAME\u0026gt; ] \u0026lt;COMPONENT\u0026gt; usage: dpm set-profile-owner [ --user \u0026lt;USER_ID\u0026gt; | current ] [ --name \u0026lt;NAME\u0026gt; ] \u0026lt;COMPONENT\u0026gt; usage: dpm remove-active-admin [ --user \u0026lt;USER_ID\u0026gt; | current ] [ --name \u0026lt;NAME\u0026gt; ] \u0026lt;COMPONENT\u0026gt; dpm set-active-admin: Sets the given component as active admin for an existing user. dpm set-device-owner: Sets the given component as active admin, and its package as device owner. dpm set-profile-owner: Sets the given component as active admin and profile owner for an existing user. dpm remove-active-admin: Disables an active admin, the admin must have declared android:testOnly in the application in its manifest. This will also remove device and profile owners. dpm clear-freeze-period-record: clears framework-maintained record of past freeze periods that the device went through. For use during feature development to prevent triggering restriction on setting freeze periods. dpm force-security-logs: makes all security logs available to the DPC and triggers DeviceAdminReceiver.onSecurityLogsAvailable() if needed. "});index.add({'id':6,'href':'/adb-translate/docs/dumpsys/','title':"Dumpsys",'section':"Docs",'content':":/system/bin # dumpsys --help usage: dumpsys To dump all services. or: dumpsys [-t TIMEOUT] [--priority LEVEL] [--help | -l | --skip SERVICES | SERVICE [ARGS]] --help: shows this help -l: only list services, do not dump them -t TIMEOUT_SEC: TIMEOUT to use in seconds instead of default 10 seconds -T TIMEOUT_MS: TIMEOUT to use in milliseconds instead of default 10 seconds --proto: filter services that support dumping data in proto format. Dumps will be in proto format. --priority LEVEL: filter services based on specified priority LEVEL must be one of CRITICAL | HIGH | NORMAL --skip SERVICES: dumps all services but SERVICES (comma-separated list) SERVICE [ARGS]: dumps only service SERVICE, optionally passing ARGS to it "});index.add({'id':7,'href':'/adb-translate/docs/getprop/','title':"Getprop",'section':"Docs",'content':":/system/bin # getprop --help usage: getprop [-TZ] [NAME [DEFAULT]] Gets an Android system property, or lists them all. -T Show property types instead of values -Z Show property contexts instead of values "});index.add({'id':8,'href':'/adb-translate/docs/logcat/','title':"Logcat",'section':"Docs",'content':":/system/bin # logcat --help Usage: logcat [options] [filterspecs] options include: -s Set default filter to silent. Equivalent to filterspec \u0026#39;*:S\u0026#39; -f \u0026lt;file\u0026gt;, --file=\u0026lt;file\u0026gt; Log to file. Default is stdout -r \u0026lt;kbytes\u0026gt;, --rotate-kbytes=\u0026lt;kbytes\u0026gt; Rotate log every kbytes. Requires -f option -n \u0026lt;count\u0026gt;, --rotate-count=\u0026lt;count\u0026gt; Sets max number of rotated logs to \u0026lt;count\u0026gt;, default 4 --id=\u0026lt;id\u0026gt; If the signature id for logging to file changes, then clear the fileset and continue -v \u0026lt;format\u0026gt;, --format=\u0026lt;format\u0026gt; Sets log print format verb and adverbs, where \u0026lt;format\u0026gt; is: brief help long process raw tag thread threadtime time and individually flagged modifying adverbs can be added: color descriptive epoch monotonic printable uid usec UTC year zone Multiple -v parameters or comma separated list of format and format modifiers are allowed. -D, --dividers Print dividers between each log buffer -c, --clear Clear (flush) the entire log and exit if Log to File specified, clear fileset instead -d Dump the log and then exit (don\u0026#39;t block) -e \u0026lt;expr\u0026gt;, --regex=\u0026lt;expr\u0026gt; Only print lines where the log message matches \u0026lt;expr\u0026gt; where \u0026lt;expr\u0026gt; is a Perl-compatible regular expression -m \u0026lt;count\u0026gt;, --max-count=\u0026lt;count\u0026gt; Quit after printing \u0026lt;count\u0026gt; lines. This is meant to be paired with --regex, but will work on its own. --print Paired with --regex and --max-count to let content bypass regex filter but still stop at number of matches. -t \u0026lt;count\u0026gt; Print only the most recent \u0026lt;count\u0026gt; lines (implies -d) -t \u0026#39;\u0026lt;time\u0026gt;\u0026#39; Print most recent lines since specified time (implies -d) -T \u0026lt;count\u0026gt; Print only the most recent \u0026lt;count\u0026gt; lines (does not imply -d) -T \u0026#39;\u0026lt;time\u0026gt;\u0026#39; Print most recent lines since specified time (not imply -d) count is pure numerical, time is \u0026#39;MM-DD hh:mm:ss.mmm...\u0026#39; \u0026#39;YYYY-MM-DD hh:mm:ss.mmm...\u0026#39; or \u0026#39;sssss.mmm...\u0026#39; format -g, --buffer-size Get the size of the ring buffer. -G \u0026lt;size\u0026gt;, --buffer-size=\u0026lt;size\u0026gt; Set size of log ring buffer, may suffix with K or M. -L, --last Dump logs from prior to last reboot -b \u0026lt;buffer\u0026gt;, --buffer=\u0026lt;buffer\u0026gt; Request alternate ring buffer, \u0026#39;main\u0026#39;, \u0026#39;system\u0026#39;, \u0026#39;radio\u0026#39;, \u0026#39;events\u0026#39;, \u0026#39;crash\u0026#39;, \u0026#39;default\u0026#39; or \u0026#39;all\u0026#39;. Multiple -b parameters or comma separated list of buffers are allowed. Buffers interleaved. Default -b main,system,crash. -B, --binary Output the log in binary. -S, --statistics Output statistics. -p, --prune Print prune white and ~black list. Service is specified as UID, UID/PID or /PID. Weighed for quicker pruning if prefix with ~, otherwise weighed for longevity if unadorned. All other pruning activity is oldest first. Special case ~! represents an automatic quicker pruning for the noisiest UID as determined by the current statistics. -P \u0026#39;\u0026lt;list\u0026gt; ...\u0026#39;, --prune=\u0026#39;\u0026lt;list\u0026gt; ...\u0026#39; Set prune white and ~black list, using same format as listed above. Must be quoted. --pid=\u0026lt;pid\u0026gt; Only prints logs from the given pid. --wrap Sleep for 2 hours or when buffer about to wrap whichever comes first. Improves efficiency of polling by providing an about-to-wrap wakeup. filterspecs are a series of \u0026lt;tag\u0026gt;[:priority] where \u0026lt;tag\u0026gt; is a log component tag (or * for all) and priority is: V Verbose (default for \u0026lt;tag\u0026gt;) D Debug (default for \u0026#39;*\u0026#39;) I Info W Warn E Error F Fatal S Silent (suppress all output) \u0026#39;*\u0026#39; by itself means \u0026#39;*:D\u0026#39; and \u0026lt;tag\u0026gt; by itself means \u0026lt;tag\u0026gt;:V. If no \u0026#39;*\u0026#39; filterspec or -s on command line, all filter defaults to \u0026#39;*:V\u0026#39;. eg: \u0026#39;*:S \u0026lt;tag\u0026gt;\u0026#39; prints only \u0026lt;tag\u0026gt;, \u0026#39;\u0026lt;tag\u0026gt;:S\u0026#39; suppresses all \u0026lt;tag\u0026gt; log messages. If not specified on the command line, filterspec is set from ANDROID_LOG_TAGS. If not specified with -v on command line, format is set from ANDROID_PRINTF_LOG or defaults to \u0026#34;threadtime\u0026#34; "});index.add({'id':9,'href':'/adb-translate/docs/pm/','title':"Pm",'section':"Docs",'content':":/system/bin # pm Package manager (package) commands: help Print this help text. path [--user USER_ID] PACKAGE Print the path to the .apk of the given PACKAGE. dump PACKAGE Print various system state associated with the given PACKAGE. list features Prints all features of the system. has-feature FEATURE_NAME [version] Prints true and returns exit status 0 when system has a FEATURE_NAME, otherwise prints false and returns exit status 1 list instrumentation [-f] [TARGET-PACKAGE] Prints all test packages; optionally only those targeting TARGET-PACKAGE Options: -f: dump the name of the .apk file containing the test package list libraries Prints all system libraries. list packages [-f] [-d] [-e] [-s] [-3] [-i] [-l] [-u] [-U] [--uid UID] [--user USER_ID] [FILTER] Prints all packages; optionally only those whose name contains the text in FILTER. Options are: -f: see their associated file -d: filter to only show disabled packages -e: filter to only show enabled packages -s: filter to only show system packages -3: filter to only show third party packages -i: see the installer for the packages -l: ignored (used for compatibility with older releases) -U: also show the package UID -u: also include uninstalled packages --uid UID: filter to only show packages with the given UID --user USER_ID: only list packages belonging to the given user list permission-groups Prints all known permission groups. list permissions [-g] [-f] [-d] [-u] [GROUP] Prints all known permissions; optionally only those in GROUP. Options are: -g: organize by group -f: print all information -s: short summary -d: only list dangerous permissions -u: list only the permissions users will see resolve-activity [--brief] [--components] [--user USER_ID] INTENT Prints the activity that resolves to the given INTENT. query-activities [--brief] [--components] [--user USER_ID] INTENT Prints all activities that can handle the given INTENT. query-services [--brief] [--components] [--user USER_ID] INTENT Prints all services that can handle the given INTENT. query-receivers [--brief] [--components] [--user USER_ID] INTENT Prints all broadcast receivers that can handle the given INTENT. install [-lrtsfdg] [-i PACKAGE] [--user USER_ID|all|current] [-p INHERIT_PACKAGE] [--install-location 0/1/2] [--originating-uri URI] [---referrer URI] [--abi ABI_NAME] [--force-sdk] [--preload] [--instantapp] [--full] [--dont-kill] [--force-uuid internal|UUID] [--pkg PACKAGE] [-S BYTES] [PATH|-] Install an application. Must provide the apk data to install, either as a file path or \u0026#39;-\u0026#39; to read from stdin. Options are: -l: forward lock application -R: disallow replacement of existing application -t: allow test packages -i: specify package name of installer owning the app -s: install application on sdcard -f: install application on internal flash -d: allow version code downgrade (debuggable packages only) -p: partial application install (new split on top of existing pkg) -g: grant all runtime permissions -S: size in bytes of package, required for stdin --user: install under the given user. --dont-kill: installing a new feature split, don\u0026#39;t kill running app --originating-uri: set URI where app was downloaded from --referrer: set URI that instigated the install of the app --pkg: specify expected package name of app being installed --abi: override the default ABI of the platform --instantapp: cause the app to be installed as an ephemeral install app --full: cause the app to be installed as a non-ephemeral full app --install-location: force the install location: 0=auto, 1=internal only, 2=prefer external --force-uuid: force install on to disk volume with given UUID --force-sdk: allow install even when existing app targets platform codename but new one targets a final API level install-create [-lrtsfdg] [-i PACKAGE] [--user USER_ID|all|current] [-p INHERIT_PACKAGE] [--install-location 0/1/2] [--originating-uri URI] [---referrer URI] [--abi ABI_NAME] [--force-sdk] [--preload] [--instantapp] [--full] [--dont-kill] [--force-uuid internal|UUID] [--pkg PACKAGE] [-S BYTES] Like \u0026#34;install\u0026#34;, but starts an install session. Use \u0026#34;install-write\u0026#34; to push data into the session, and \u0026#34;install-commit\u0026#34; to finish. install-write [-S BYTES] SESSION_ID SPLIT_NAME [PATH|-] Write an apk into the given install session. If the path is \u0026#39;-\u0026#39;, data will be read from stdin. Options are: -S: size in bytes of package, required for stdin install-commit SESSION_ID Commit the given active install session, installing the app. install-abandon SESSION_ID Delete the given active install session. set-install-location LOCATION Changes the default install location. NOTE this is only intended for debugging; using this can cause applications to break and other undersireable behavior. LOCATION is one of: 0 [auto]: Let system decide the best location 1 [internal]: Install on internal device storage 2 [external]: Install on external media get-install-location Returns the current install location: 0, 1 or 2 as per set-install-location. move-package PACKAGE [internal|UUID] move-primary-storage [internal|UUID] pm uninstall [-k] [--user USER_ID] [--versionCode VERSION_CODE] PACKAGE [SPLIT] Remove the given package name from the system. May remove an entire app if no SPLIT name is specified, otherwise will remove only the split of the given app. Options are: -k: keep the data and cache directories around after package removal. --user: remove the app from the given user. --versionCode: only uninstall if the app has the given version code. clear [--user USER_ID] PACKAGE Deletes all data associated with a package. enable [--user USER_ID] PACKAGE_OR_COMPONENT disable [--user USER_ID] PACKAGE_OR_COMPONENT disable-user [--user USER_ID] PACKAGE_OR_COMPONENT disable-until-used [--user USER_ID] PACKAGE_OR_COMPONENT default-state [--user USER_ID] PACKAGE_OR_COMPONENT These commands change the enabled state of a given package or component (written as \u0026#34;package/class\u0026#34;). hide [--user USER_ID] PACKAGE_OR_COMPONENT unhide [--user USER_ID] PACKAGE_OR_COMPONENT suspend [--user USER_ID] TARGET-PACKAGE Suspends the specified package (as user). unsuspend [--user USER_ID] TARGET-PACKAGE Unsuspends the specified package (as user). grant [--user USER_ID] PACKAGE PERMISSION revoke [--user USER_ID] PACKAGE PERMISSION These commands either grant or revoke permissions to apps. The permissions must be declared as used in the app\u0026#39;s manifest, be runtime permissions (protection level dangerous), and the app targeting SDK greater than Lollipop MR1. reset-permissions Revert all runtime permissions to their default state. set-permission-enforced PERMISSION [true|false] get-privapp-permissions TARGET-PACKAGE Prints all privileged permissions for a package. get-privapp-deny-permissions TARGET-PACKAGE Prints all privileged permissions that are denied for a package. get-oem-permissions TARGET-PACKAGE Prints all OEM permissions for a package. set-app-link [--user USER_ID] PACKAGE {always|ask|never|undefined} get-app-link [--user USER_ID] PACKAGE trim-caches DESIRED_FREE_SPACE [internal|UUID] Trim cache files to reach the given free space. create-user [--profileOf USER_ID] [--managed] [--restricted] [--ephemeral] [--guest] USER_NAME Create a new user with the given USER_NAME, printing the new user identifier of the user. remove-user USER_ID Remove the user with the given USER_IDENTIFIER, deleting all data associated with that user set-user-restriction [--user USER_ID] RESTRICTION VALUE get-max-users get-max-running-users compile [-m MODE | -r REASON] [-f] [-c] [--split SPLIT_NAME] [--reset] [--check-prof (true | false)] (-a | TARGET-PACKAGE) Trigger compilation of TARGET-PACKAGE or all packages if \u0026#34;-a\u0026#34;. Options are: -a: compile all packages -c: clear profile data before compiling -f: force compilation even if not needed -m: select compilation mode MODE is one of the dex2oat compiler filters: assume-verified extract verify quicken space-profile space speed-profile speed everything -r: select compilation reason REASON is one of: first-boot boot install bg-dexopt ab-ota inactive shared --reset: restore package to its post-install state --check-prof (true | false): look at profiles when doing dexopt? --secondary-dex: compile app secondary dex files --split SPLIT: compile only the given split name force-dex-opt PACKAGE Force immediate execution of dex opt for the given PACKAGE. bg-dexopt-job Execute the background optimizations immediately. Note that the command only runs the background optimizer logic. It may overlap with the actual job but the job scheduler will not be able to cancel it. It will also run even if the device is not in the idle maintenance mode. reconcile-secondary-dex-files TARGET-PACKAGE Reconciles the package secondary dex files with the generated oat files. dump-profiles TARGET-PACKAGE Dumps method/class profile files to /data/misc/profman/TARGET-PACKAGE.txt snapshot-profile TARGET-PACKAGE [--code-path path] Take a snapshot of the package profiles to /data/misc/profman/TARGET-PACKAGE[-code-path].prof If TARGET-PACKAGE=android it will take a snapshot of the boot image set-home-activity [--user USER_ID] TARGET-COMPONENT Set the default home activity (aka launcher). set-installer PACKAGE INSTALLER Set installer package name get-instantapp-resolver Return the name of the component that is the current instant app installer. set-harmful-app-warning [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE\u0026gt; [\u0026lt;WARNING\u0026gt;] Mark the app as harmful with the given warning message. get-harmful-app-warning [--user \u0026lt;USER_ID\u0026gt;] \u0026lt;PACKAGE\u0026gt; Return the harmful app warning message for the given app, if present uninstall-system-updates Remove updates to all system applications and fall back to their /system version. \u0026lt;INTENT\u0026gt; specifications include these flags and arguments: [-a \u0026lt;ACTION\u0026gt;] [-d \u0026lt;DATA_URI\u0026gt;] [-t \u0026lt;MIME_TYPE\u0026gt;] [-c \u0026lt;CATEGORY\u0026gt; [-c \u0026lt;CATEGORY\u0026gt;] ...] [-n \u0026lt;COMPONENT_NAME\u0026gt;] [-e|--es \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_STRING_VALUE\u0026gt; ...] [--esn \u0026lt;EXTRA_KEY\u0026gt; ...] [--ez \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_BOOLEAN_VALUE\u0026gt; ...] [--ei \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_INT_VALUE\u0026gt; ...] [--el \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_LONG_VALUE\u0026gt; ...] [--ef \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_FLOAT_VALUE\u0026gt; ...] [--eu \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_URI_VALUE\u0026gt; ...] [--ecn \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_COMPONENT_NAME_VALUE\u0026gt;] [--eia \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_INT_VALUE\u0026gt;[,\u0026lt;EXTRA_INT_VALUE...]] (mutiple extras passed as Integer[]) [--eial \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_INT_VALUE\u0026gt;[,\u0026lt;EXTRA_INT_VALUE...]] (mutiple extras passed as List\u0026lt;Integer\u0026gt;) [--ela \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_LONG_VALUE\u0026gt;[,\u0026lt;EXTRA_LONG_VALUE...]] (mutiple extras passed as Long[]) [--elal \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_LONG_VALUE\u0026gt;[,\u0026lt;EXTRA_LONG_VALUE...]] (mutiple extras passed as List\u0026lt;Long\u0026gt;) [--efa \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_FLOAT_VALUE\u0026gt;[,\u0026lt;EXTRA_FLOAT_VALUE...]] (mutiple extras passed as Float[]) [--efal \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_FLOAT_VALUE\u0026gt;[,\u0026lt;EXTRA_FLOAT_VALUE...]] (mutiple extras passed as List\u0026lt;Float\u0026gt;) [--esa \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_STRING_VALUE\u0026gt;[,\u0026lt;EXTRA_STRING_VALUE...]] (mutiple extras passed as String[]; to embed a comma into a string, escape it using \u0026#34;\\,\u0026#34;) [--esal \u0026lt;EXTRA_KEY\u0026gt; \u0026lt;EXTRA_STRING_VALUE\u0026gt;[,\u0026lt;EXTRA_STRING_VALUE...]] (mutiple extras passed as List\u0026lt;String\u0026gt;; to embed a comma into a string, escape it using \u0026#34;\\,\u0026#34;) [-f \u0026lt;FLAG\u0026gt;] [--grant-read-uri-permission] [--grant-write-uri-permission] [--grant-persistable-uri-permission] [--grant-prefix-uri-permission] [--debug-log-resolution] [--exclude-stopped-packages] [--include-stopped-packages] [--activity-brought-to-front] [--activity-clear-top] [--activity-clear-when-task-reset] [--activity-exclude-from-recents] [--activity-launched-from-history] [--activity-multiple-task] [--activity-no-animation] [--activity-no-history] [--activity-no-user-action] [--activity-previous-is-top] [--activity-reorder-to-front] [--activity-reset-task-if-needed] [--activity-single-top] [--activity-clear-task] [--activity-task-on-home] [--activity-match-external] [--receiver-registered-only] [--receiver-replace-pending] [--receiver-foreground] [--receiver-no-abort] [--receiver-include-background] [--selector] [\u0026lt;URI\u0026gt; | \u0026lt;PACKAGE\u0026gt; | \u0026lt;COMPONENT\u0026gt;] "});index.add({'id':10,'href':'/adb-translate/docs/screencap/','title':"Screencap",'section':"Docs",'content':":/system/bin # screencap -h usage: screencap [-hp] [-d display-id] [FILENAME] -h: this message -p: save the file as a png. -d: specify the display id to capture, default 0. If FILENAME ends with .png it will be saved as a png. If FILENAME is not given, the results will be printed to stdout. "});index.add({'id':11,'href':'/adb-translate/docs/screenrecord/','title':"Screenrecord",'section':"Docs",'content':":/system/bin # screenrecord --help Usage: screenrecord [options] \u0026lt;filename\u0026gt; Android screenrecord v1.2. Records the device\u0026#39;s display to a .mp4 file. Options: --size WIDTHxHEIGHT Set the video size, e.g. \u0026#34;1280x720\u0026#34;. Default is the device\u0026#39;s main display resolution (if supported), 1280x720 if not. For best results, use a size supported by the AVC encoder. --bit-rate RATE Set the video bit rate, in bits per second. Value may be specified as bits or megabits, e.g. \u0026#39;4000000\u0026#39; is equivalent to \u0026#39;4M\u0026#39;. Default 20Mbps. --bugreport Add additional information, such as a timestamp overlay, that is helpful in videos captured to illustrate bugs. --time-limit TIME Set the maximum recording time, in seconds. Default / maximum is 180. --verbose Display interesting information on stdout. --help Show this message. Recording continues until Ctrl-C is hit or the time limit is reached. "});index.add({'id':12,'href':'/adb-translate/docs/service/','title':"Service",'section':"Docs",'content':":/system/bin # service -h Usage: service [-h|-?] service list service check SERVICE service call SERVICE CODE [i32 N | i64 N | f N | d N | s16 STR ] ... Options: i32: Write the 32-bit integer N into the send parcel. i64: Write the 64-bit integer N into the send parcel. f: Write the 32-bit single-precision number N into the send parcel. d: Write the 64-bit double-precision number N into the send parcel. s16: Write the UTF-16 string STR into the send parcel. "});index.add({'id':13,'href':'/adb-translate/docs/setenforce/','title':"Setenforce",'section':"Docs",'content':":/system/bin # setenforce --help usage: setenforce [enforcing|permissive|1|0] Sets whether SELinux is enforcing (1) or permissive (0). "});index.add({'id':14,'href':'/adb-translate/docs/setprop/','title':"Setprop",'section':"Docs",'content':":/system/bin # setprop --help usage: setprop NAME VALUE Sets an Android system property. "});index.add({'id':15,'href':'/adb-translate/docs/settings/','title':"Settings",'section':"Docs",'content':":/system/bin # settings Settings provider (settings) commands: help Print this help text. get [--user \u0026lt;USER_ID\u0026gt; | current] NAMESPACE KEY Retrieve the current value of KEY. put [--user \u0026lt;USER_ID\u0026gt; | current] NAMESPACE KEY VALUE [TAG] [default] Change the contents of KEY to VALUE. TAG to associate with the setting. {default} to set as the default, case-insensitive only for global/secure namespace delete NAMESPACE KEY Delete the entry for KEY. reset [--user \u0026lt;USER_ID\u0026gt; | current] NAMESPACE {PACKAGE_NAME | RESET_MODE} Reset the global/secure table for a package with mode. RESET_MODE is one of {untrusted_defaults, untrusted_clear, trusted_defaults}, case-insensitive list NAMESPACE Print all defined keys. NAMESPACE is one of {system, secure, global}, case-insensitive "});index.add({'id':16,'href':'/adb-translate/docs/svc/','title':"Svc",'section':"Docs",'content':":/system/bin # svc Available commands: help Show information about the subcommands power Control the power manager data Control mobile data connectivity wifi Control the Wi-Fi manager usb Control Usb state nfc Control NFC functions bluetooth Control Bluetooth service "});index.add({'id':17,'href':'/adb-translate/docs/telecom/','title':"Telecom",'section':"Docs",'content':":/system/bin # telecom usage: telecom [subcommand] [options] usage: telecom set-phone-account-enabled \u0026lt;COMPONENT\u0026gt; \u0026lt;ID\u0026gt; \u0026lt;USER_SN\u0026gt; usage: telecom set-phone-account-disabled \u0026lt;COMPONENT\u0026gt; \u0026lt;ID\u0026gt; \u0026lt;USER_SN\u0026gt; usage: telecom register-phone-account \u0026lt;COMPONENT\u0026gt; \u0026lt;ID\u0026gt; \u0026lt;USER_SN\u0026gt; \u0026lt;LABEL\u0026gt; usage: telecom register-sim-phone-account \u0026lt;COMPONENT\u0026gt; \u0026lt;ID\u0026gt; \u0026lt;USER_SN\u0026gt; \u0026lt;LABEL\u0026gt; \u0026lt;ADDRESS\u0026gt; usage: telecom unregister-phone-account \u0026lt;COMPONENT\u0026gt; \u0026lt;ID\u0026gt; \u0026lt;USER_SN\u0026gt; usage: telecom set-default-dialer \u0026lt;PACKAGE\u0026gt; usage: telecom get-default-dialer usage: telecom get-system-dialer usage: telecom wait-on-handlers telecom set-phone-account-enabled: Enables the given phone account, if it has already been registered with Telecom. telecom set-phone-account-disabled: Disables the given phone account, if it has already been registered with telecom. telecom set-default-dialer: Sets the default dialer to the given component. telecom get-default-dialer: Displays the current default dialer. telecom get-system-dialer: Displays the current system dialer. telecom wait-on-handlers: Wait until all handlers finish their work. "});index.add({'id':18,'href':'/adb-translate/docs/toybox/','title':"Toybox",'section':"Docs",'content':":/system/bin # toybox acpi base64 basename blkid blockdev cal cat chattr chcon chgrp chmod chown chroot chrt cksum clear cmp comm cp cpio cut date dd df diff dirname dmesg dos2unix du echo egrep env expand expr fallocate false fgrep file find flock fmt free freeramdisk fsfreeze getenforce getfattr grep groups gunzip gzip head help hostname hwclock id ifconfig inotifyd insmod install ionice iorenice iotop kill killall ln load_policy log logname losetup ls lsattr lsmod lsof lspci lsusb makedevs md5sum microcom mkdir mkfifo mknod mkswap mktemp modinfo modprobe more mount mountpoint mv nbd-client nc netcat netstat nice nl nohup od partprobe paste patch pgrep pidof pivot_root pkill pmap printenv printf ps pwd pwdx readlink realpath renice restorecon rev rfkill rm rmdir rmmod runcon sed sendevent seq setenforce setfattr setprop setsid sha1sum sha224sum sha256sum sha384sum sha512sum sleep sort split start stat stop strings stty swapoff swapon sync sysctl tac tail tar taskset tee time timeout top touch tr traceroute traceroute6 true truncate tty tunctl ulimit umount uname uniq unix2dos uptime usleep uudecode uuencode vconfig vmstat wc which whoami xargs xxd yes zcat "});index.add({'id':19,'href':'/adb-translate/docs/wm/','title':"Wm",'section':"Docs",'content':":/system/bin # wm Window manager (window) commands: help Print this help text. size [reset|WxH|WdpxHdp] Return or override display size. width and height in pixels unless suffixed with \u0026#39;dp\u0026#39;. density [reset|DENSITY] Return or override display density. overscan [reset|LEFT,TOP,RIGHT,BOTTOM] Set overscan area for display. scaling [off|auto] Set display scaling mode. dismiss-keyguard Dismiss the keyguard, prompting user for auth if necessary. "});index.add({'id':20,'href':'/adb-translate/docs/%E7%AE%80%E6%98%8E%E5%91%BD%E4%BB%A4%E7%BF%BB%E8%AF%91/','title':"简明命令翻译",'section':"Docs",'content':"   命令 英文 翻译      am Activity manager 活动管理器    appops AppOps service 软件权限服务    busybox      cmd      dpm      dumpsys      getprop      logcat      pm Package manager 软件包管理器    screencap      screenrecord      service      setenforce      setprop      settings      svc      telecom      toybox      wm                               "});})();